Podemos ocupar la siguiente función definida en python para calcular la secuencia de fibonacci: def fibonacci(n): if n == 0: return 0 elif n == 1: return 1 else: return fibonacci(n-1) + fibonacci(n-2) print(fibonacci(10)) Como es claro, los casos base son los dos primeros valores de la secuencia. Mientras que el resto se calcula revisando el valores de los anteriores valores de la secuencia. En C++ el código sería el siguiente: ~#include <iostream>
~using namespace std;
~
int fibonacci(int n) { if (n == 0) { return 0; } else if (n == 1) { return 1; } else { return fibonacci(n-1) + fibonacci(n-2); }
} ~int main() { cout << fibonacci(10) << endl;
~ return 0;
